import store from './Redux/Stores/Store';
import ListItemView from './views/ListItemView'
import ImagePickerDemo from './views/ImagePickerDemo';

export default function App() {
  return (
    
    <Provider store={store}>
      <PageManage/>
      {/* <ImagePickerDemo/> */}
     </Provider>

   );
}

